import React from 'react';

const Footer = () => {
    return (
        <Container>
            <Wrapper>
                <List>
                    <ListItem>Guide</ListItem>
                    <ListItem>Support</ListItem>
                    <ListItem>API</ListItem>
                    <ListItem>Community</ListItem>
                </List>
                <CopyRight>BY GUVEN</CopyRight>
            </Wrapper>
        </Container>
    );
};

export default Footer;
